export const Footer = () => {
   return (
      <footer className="header footer">
         <Lin className="logo" href='#' >
            <img src='./img/logo.png' alt='logo' />
            <p>Книжная лавка</p>
         </Lin>
        <p>bookshop@gmail.com</p>
        
      </footer>
   )
}
